import styled from 'styled-components'

export const StyledTeam = styled.div`
	padding: 0;
  margin: 0;
  list-style: none;
  -ms-box-orient: horizontal;
  display: -webkit-box;
  display: -moz-box;
  display: -ms-flexbox;
  display: -moz-flex;
  display: -webkit-flex;
  display: flex;
  float: left;
  -webkit-align-items: baseline; 
  align-items: baseline;
`;
